import { connect } from 'react-redux';
import MyPokemonList from './myPokemonList'


function mapStateToProps(state){
    return{
      myPokemon: state.pokemon.myPokemon
    }
}  

export default connect(
    mapStateToProps
)(MyPokemonList)
